 We can use React Context to create a scope context for the Tooltip component.

## Create a Tooltip Context

Create a Tooltip Context to store the Tooltip state and the function to close the Tooltip.
```
import { createContext } from "react";

export const TooltipContext = createContext({
  closeTooltip: () => {},
  tooltipOpen: false,
});
```
## Create a Tooltip Provider

Create a Tooltip Provider to provide the Tooltip state and the function to close the Tooltip.
```
import { TooltipContext } from "./TooltipContext";
import { useState } from "react";

export const TooltipProvider = ({ children }) => {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  const closeTooltip = () => {
    setTooltipOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ closeTooltip, tooltipOpen }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
## Create a Tooltip Component

Create a Tooltip component to display the Tooltip.
```
import { TooltipContext } from "./TooltipContext";
import { useContext } from "react";

export const Tooltip = ({ children, text }) => {
  const { closeTooltip, tooltipOpen } = useContext(TooltipContext);

  return (
    <div className="relative">
      <div className="absolute bottom-0 left-0 z-10">
        <div className="bg-black text-white p-2 rounded">
          <p>{text}</p>
        </div>
      </div>
      <div
        className="relative"
        onMouseEnter={() => closeTooltip()}
        onMouseLeave={() => closeTooltip()}
      >
        {children}
      </div>
    </div>
  );
};
```
## Use the Tooltip Component

Use the Tooltip component in your NextJS application.
```
import { TooltipProvider } from "./TooltipProvider";
import { Tooltip } from "./Tooltip";

export default function Home() {
  return (
    <TooltipProvider>
      <div className="flex flex-col items-center justify-center min-h-screen py-2">
        <Tooltip text="This is a tooltip">
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Hover me
          </button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
}
```
## Conclusion

We have created a Tooltip component that can be used in different places in your NextJS application. We have also created a Tooltip Context to store the Tooltip state and the function to close the Tooltip. We have also created a Tooltip Provider to provide the Tooltip state and the function to close the Tooltip. We have also created a Tooltip component to display the Tooltip. We have also used the Tooltip component in our NextJS application.

