@divinedolphin Hi there! I'll be happy to answer your question. This is a really cool problem, since you get to see how geometry can be used in everyday life. I actually did a similar problem myself a little while ago. The first question to ask yourself is, "What do I need to know about the situation in order to be able to answer the question being asked?" Here, you want to know how fast Mrs. Wood should drive if she wants to save 15 minutes of commuting time. The amount of time you spend driving is dependent on the speed at which you drive and the distance you drive. You already know that the distance between Summerstone and Foxfield is 75 miles. And you can figure out how long it took Mrs. Wood to drive to work by looking at the time she left home and the time she arrived. So the only thing you're missing is the speed at which she drove. Once you have that information, you can figure out at what speed she should have gone if she wanted her commute to be 15 minutes shorter. I hope this was helpful. Happy Learning, TheDailyGamer

